from collections import Counter
from math import isqrt
from typing import List

class Solution:
    def checkPrimeFrequency(self, nums: List[int]) -> bool:
        # frequency map
        freq = Counter(nums)

        # find if n is prime
        def is_prime(n: int) -> bool:
            if n <= 1:
                return False
            if n <= 3:
                return True
            if n % 2 == 0:
                return False
            limit = isqrt(n)
            for d in range(3, limit + 1, 2):
                if n % d == 0:
                    return False
            return True

        for f in freq.values():
            if is_prime(f):
                return True
        return False
